package com.illumi.dms.model.test_dms;import com.alibaba.fastjson.JSON;import com.illumi.dms.common.utils.ValidateObjectUtil;import com.illumi.dms.model.test_poker.TUserBaseIinfo;import com.jayqqaa12.jbase.jfinal.ext.model.EasyuiModel;import com.jayqqaa12.model.easyui.DataGrid;import com.jayqqaa12.model.easyui.Form;import com.jfinal.ext.plugin.tablebind.TableBind;import org.slf4j.LoggerFactory;import java.text.SimpleDateFormat;import java.util.List;@TableBind(tableName = "regdate_uuid")public class RegdateUUID extends EasyuiModel<RegdateUUID> {    private static org.slf4j.Logger logger = LoggerFactory.getLogger(TUserBaseIinfo.class);    private static final long serialVersionUID = -7615377924993713398L;    public static RegdateUUID dao = new RegdateUUID();    public long getYesdayLastUserOfUUID(){        StringBuffer sql  = new StringBuffer("select * from regdate_uuid order by date desc limit 1");        logger.info(sql.toString());        List<RegdateUUID> result =  this.find(sql.toString());        if(ValidateObjectUtil.isNotBlank(result)){            logger.info(String.format(">>>>>>>>>> :%s",result.get(0).get("uuid_end")));            return ValidateObjectUtil.isBlankDefault(result.get(0).get("uuid_end"),0,0);        }        return 0;    }}